w.opengis.net/gml/3.2" xsi:type="gmd:PT_FreeText_PropertyType">\r\n        <gco:CharacterString>Répondre aux questions agricoles posées par le projet de 3ème correction du Rhône dans le domaine de l’agriculture.</gco:CharacterString>\r\n        <gmd:PT_FreeText>\r\n          <gmd:textGroup>\r\n            <gmd:LocalisedCharacterString locale="#FR">Répondre aux questions agricoles posées par le projet de 3ème correction du Rhône dans le domaine de l’agriculture.</gmd:LocalisedCharacterString>\r\n          </gmd:textGroup>\r\n          <gmd:textGroup>\r\n            <gmd:LocalisedCharacterString locale="#DE">Antworten auf die durch das Projekt der 3. Rhonekorrektion aufgeworfenen Fragen im Bereich der Landwirtschaft zu finden.</gmd:LocalisedCharacterString>\r\n          </gmd:textGroup>\r\n        </gmd:PT_FreeText>\r\n      </gmd:purpose>\r\n      <gmd:status xmlns:gml320="http://www.opengis.net/gml/3.2">\r\n        <gmd:MD_ProgressCode codeList="http://standards.iso.org/ittf/PubliclyAvailableStandards/ISO_19139_Schemas/resources/codelist/ML_gmxCodelists.xml#MD_ProgressCode" codeListValue="completed" />\r\n      </gmd:status>\r\n      <gmd:pointOfContact xmlns:gml320="http://www.opengis.net/gml/3.2" xlink:href="local://srv/api/registries/entries/ee7272d2-c9d1-412b-a81e-f40f4029d01c?lang=fre,ger,ita,eng,roh&amp;process=gmd:role/gmd:CI_RoleCode/@codeListValue~custodian&amp;schema=iso19139.che">\r\n        <gmd:CI_ResponsibleParty>\r\n          <gmd:organisationName xsi:type="gmd:PT_FreeText_PropertyType">\r\n            <gco:CharacterString>Canton du Valais - Service de l'environnement (SEN) - Protection des sols</gco:CharacterString>\r\n            <gmd:PT_FreeText>\r\n              <gmd:textGroup>\r\n                <gmd:LocalisedCharacterString locale="#FR">Canton du Valais - Service de l'environnement (SEN) - Protection des sols</gmd:LocalisedCharacterString>\r\n              </gmd:textGroup>\r\n              <gmd:textGroup>\r\n                <gmd:LocalisedCharact