auliques wallonnes.\r\n\r\nLes cumulées sont des indications de distance entre l'origine et l'extrémité d'un segment de voie hydraulique. Elles sont exprimées en mètre. Le début d'un segment considéré présente une cumulée de 0m. Un point de cumulée sur le segment indique donc la distance cumulée de l'origine du segment à ce point. Les cumulées sont toujours croissantes depuis le début du segment.\r\n\r\nLes cumulées permettent de mesurer des distances le long des voies hydrauliques mais également de localiser précisément un événement ou un ouvrage le long d'un axe.\r\n\r\nCette couche de données doit être exploitée en surimpression des axes de voies hydrauliques.</gco:CharacterString>\r\n      </gmd:abstract>\r\n      <gmd:status>\r\n        <gmd:MD_ProgressCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#MD_ProgressCode" codeListValue="completed">completed</gmd:MD_ProgressCode>\r\n      </gmd:status>\r\n      <gmd:pointOfContact>\r\n        <gmd:CI_ResponsibleParty>\r\n          <gmd:organisationName>\r\n            <gco:CharacterString>Helpdesk carto du SPW (SPW - Secrétariat général - SPW Digital - Département de la Géomatique - Direction de l'Intégration des géodonnées)</gco:CharacterString>\r\n          </gmd:organisationName>\r\n          <gmd:contactInfo>\r\n            <gmd:CI_Contact>\r\n              <gmd:address>\r\n                <gmd:CI_Address>\r\n                  <gmd:electronicMailAddress>\r\n                    <gco:CharacterString>helpdesk.carto@spw.wallonie.be</gco:CharacterString>\r\n                  </gmd:electronicMailAddress>\r\n                </gmd:CI_Address>\r\n              </gmd:address>\r\n            </gmd:CI_Contact>\r\n          </gmd:contactInfo>\r\n          <gmd:role>\r\n            <gmd:CI_RoleCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_RoleCode" codeListValue="pointOfContact">pointOfContact</gmd:CI_RoleCode>\r\n          </gmd:role>\r\n        </gmd:CI_Responsibl