deList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_DateTypeCode" codeListValue="revision">revision</gmd:CI_DateTypeCode>\r\n              </gmd:dateType>\r\n            </gmd:CI_Date>\r\n          </gmd:date>\r\n          <gmd:date>\r\n            <gmd:CI_Date>\r\n              <gmd:date>\r\n                <gco:Date>2019-12-10</gco:Date>\r\n              </gmd:date>\r\n              <gmd:dateType>\r\n                <gmd:CI_DateTypeCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_DateTypeCode" codeListValue="publication">publication</gmd:CI_DateTypeCode>\r\n              </gmd:dateType>\r\n            </gmd:CI_Date>\r\n          </gmd:date>\r\n          <gmd:identifier>\r\n            <gmd:RS_Identifier>\r\n              <gmd:code>\r\n                <gco:CharacterString>011963da-afc0-494c-a2cc-5cbd59e122e4</gco:CharacterString>\r\n              </gmd:code>\r\n              <gmd:codeSpace>\r\n                <gco:CharacterString>http://geodata.wallonie.be/id/</gco:CharacterString>\r\n              </gmd:codeSpace>\r\n            </gmd:RS_Identifier>\r\n          </gmd:identifier>\r\n          <gmd:identifier>\r\n            <gmd:MD_Identifier>\r\n              <gmd:code>\r\n                <gco:CharacterString>UWWTD_WASTE_WATER_TREATMENT</gco:CharacterString>\r\n              </gmd:code>\r\n            </gmd:MD_Identifier>\r\n          </gmd:identifier>\r\n        </gmd:CI_Citation>\r\n      </gmd:citation>\r\n      <gmd:abstract>\r\n        <gco:CharacterString>Cette couche de points reprend les informations sur les stations d’épurations (STEP) rapportées dans le cadre de la Directive 91/271/EEC UWWT.\r\n\r\nLes stations d'épuration sont la partie la plus visible du système d'assainissement. Les eaux usées y sont traitées, habituellement suivant un processus biologique naturel. Au terme du traitement, l'eau épurée est suffisamment propre pour être rejetée dans un cours d'eau. En aucun cas, en Wallonie, les stations d'épuration d'eaux usées ne produisent de l'eau potable. Seules sont représentées au PASH les stations d'épuration publiques (ou collectives) qui épurent les eaux urbaines issues du réseau d'égouts et amenées par les collecteurs avant le rejet en rivière. Elles se réfèrent au régime d'assainissement collectif. Les stations collectives sont gérées par les organismes d’assainissement agréé (OAA) et sont financées par la SPGE. Des stations d'épuration situées hors du territoire wallon mais auxquelles sont connectées certaines agglomérations wallonnes sont également cartographiées. Les données relatives aux stations d’épuration, sont reprises à titre indicatif et n’ont pas force obligatoire contrairement aux données liées aux régimes d’assainissement.</gco:CharacterString>\r\n      </gmd:abstract>\r\n      <gmd:credit>\r\n        <gco:CharacterString>SPGE</gco:CharacterString>\r\n      </gmd:credit>\r\n      <gmd:status>\r\n        <gmd:MD_ProgressCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#MD_ProgressCode" codeListValue="planned">planned</gmd:MD_ProgressCode>\r\n      </gmd:status>\r\n      <gmd:pointOfContact>\r\n        <gmd:CI_ResponsibleParty>\r\n          <gmd:organisationName>\r\n            <gco:CharacterString>Helpdesk carto du SPW (SPW - Secrétariat général - SPW Digital - Département de la Géomatique - Direction de l'Intégration des géodonnées)</gco:CharacterString>\r\n          </gmd:organisationName>\r\n          <gmd:contactInfo>\r\n            <gmd:CI_Contact>\r\n              <gmd:address>\r\n                <gmd:CI_Address>\r\n                  <gmd:electronicMailAddress>\r\n                    <gco:CharacterString>helpdesk.carto@spw.wallonie.be</gco:CharacterString>\r\n                  </gmd:electronicMailAddress>\r\n                </gmd:CI_Address>\r\n              </gmd:address>\r\n            </gmd:CI_Contact>\r\n          </gmd:contactInfo>\r\n          <gmd:role>\r\n            <gmd:CI_RoleCode codeList="http