               <gco:CharacterString>Cette couche de données ne fait pas l'objet d'une distribution sur support physique.\r\n\r\nL'utilisation des géoservices et de l'application est recommandée.</gco:CharacterString>\r\n              </gmd:orderingInstructions>\r\n            </gmd:MD_StandardOrderProcess>\r\n          </gmd:distributionOrderProcess>\r\n        </gmd:MD_Distributor>\r\n      </gmd:distributor>\r\n      <gmd:transferOptions>\r\n        <gmd:MD_DigitalTransferOptions>\r\n          <gmd:onLine>\r\n            <gmd:CI_OnlineResource>\r\n              <gmd:linkage>\r\n                <gmd:URL>http://environnement.wallonie.be/legis/Codeenvironnement/codeeaucoordonneR.html</gmd:URL>\r\n              </gmd:linkage>\r\n              <gmd:protocol>\r\n                <gco:CharacterString>WWW:LINK</gco:CharacterString>\r\n              </gmd:protocol>\r\n              <gmd:name>\r\n                <gco:CharacterString>Code de l'eau en Wallonie</gco:CharacterString>\r\n              </gmd:name>\r\n              <gmd:function>\r\n                <gmd:CI_OnLineFunctionCode codeList="http://standards.iso.org/iso/19115/resources/Codelists/cat/codelists.xml#CI_OnLineFunctionCode" codeListValue="information" />\r\n              </gmd:function>\r\n            </gmd:CI_OnlineResource>\r\n          </gmd:onLine>\r\n        </gmd:MD_DigitalTransferOptions>\r\n      </gmd:transferOptions>\r\n    </gmd:MD_Distribution>\r\n  </gmd:distributionInfo>\r\n  <gmd:dataQualityInfo>\r\n    <gmd:DQ_DataQuality>\r\n      <gmd:scope>\r\n        <gmd:MD_Scope>\r\n          <gmd:level>\r\n            <gmd:MD_ScopeCode codeList="http://standards.iso.org/iso/19115/resources/Codelists/cat/codelists.xml#MD_ScopeCode" codeListValue="dataset" />\r\n          </gmd:level>\r\n        </gmd:MD_Scope>\r\n      </gmd:scope>\r\n      <gmd:lineage>\r\n        <gmd:LI_Lineage>\r\n          <gmd:statement>\r\n            <gco:CharacterString>Cadre législatif :\r\nLa réalisation des Plans d’assainissement par sous-bassin hydrographique (PASH) est inscrite dans l’arrêté du 3 mars 2005 du Gouvernement wallon relatif au Livre II du Code de l'Environnement, contenant le Code de l'Eau du Gouvernement wallon (AGW) – Partie III – Gestion du cycle anthropique de l’eau – Chapitre VI: Règlement général d’assainissement des eaux urbaines résiduaires (RGA). Le RGA avait précédemment été approuvé par un arrêté du Gouvernement wallon du 22 mai 2003.\r\n\r\nLe Gouvernement a chargé la SPGE de l'élaboration des PASH et de ses révisions. \r\n\r\nDonnées sources :\r\nLes coordonnées XY transmises par les gestionnaires (OAA)\r\n\r\nReprésentation :\r\nLa représentation des STEP est uniforme sur l'ensemble du territoire wallon. \r\n\r\nOrganisation de la révision :\r\nCette couche de points est mise à jour annuellement. Les informations liées aux STEP évoluent sont fonction de l’état d’avancement de divers projets mis en œuvre par le Organismes d’Assainissements Agrées (OAA). La SPGE assure la coordination de ces projets qui sont reliés de manière informatique à la cartographie ce qui permet d’automatiser l’état des diverses infrastructures en fonction de l’évolution des dossiers.</gco:CharacterString>\r\n          </gmd:statement>\r\n        </gmd:LI_Lineage>\r\n      </gmd:lineage>\r\n    </gmd:DQ_DataQuality>\r\n  </gmd:dataQualityInfo>\r\n</gmd:MD_Metadata>	2023-05-11T06:37:22.850Z	2023-05-11T06:37:22.850Z	0	\N	\N	0	0	gmd:MD_Metadata	iso19139	\N	n	y	\N	cec997ba-1fa4-48d9-8be0-890da8cc65cf	2	1	cec997ba-1fa4-48d9-8be0-890da8cc65cf	011963da-afc0-494c-a2cc-5cbd59e122e4
