    <gmd:referenceSystemIdentifier>\r\n        <gmd:RS_Identifier>\r\n          <gmd:code>\r\n            <gmx:Anchor xlink:href="http://www.opengis.net/def/crs/EPSG/0/3812">EPSG:3812</gmx:Anchor>\r\n          </gmd:code>\r\n        </gmd:RS_Identifier>\r\n      </gmd:referenceSystemIdentifier>\r\n    </gmd:MD_ReferenceSystem>\r\n  </gmd:referenceSystemInfo>\r\n  <gmd:identificationInfo>\r\n    <srv:SV_ServiceIdentification>\r\n      <gmd:citation>\r\n        <gmd:CI_Citation>\r\n          <gmd:title>\r\n            <gco:CharacterString>INSPIRE - Occupation des terres en Wallonie (BE) - Service de téléchargement</gco:CharacterString>\r\n          </gmd:title>\r\n          <gmd:date>\r\n            <gmd:CI_Date>\r\n              <gmd:date>\r\n                <gco:Date>2018-03-01</gco:Date>\r\n              </gmd:date>\r\n              <gmd:dateType>\r\n                <gmd:CI_DateTypeCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_DateTypeCode" codeListValue="publication">publication</gmd:CI_DateTypeCode>\r\n              </gmd:dateType>\r\n            </gmd:CI_Date>\r\n          </gmd:date>\r\n          <gmd:identifier>\r\n            <gmd:RS_Identifier>\r\n              <gmd:code>\r\n                <gco:CharacterString>014a4971-03f6-4da1-a8e4-aa07d428ba9e</gco:CharacterString>\r\n              </gmd:code>\r\n              <gmd:codeSpace>\r\n                <gco:CharacterString>http://geodata.wallonie.be/id/</gco:CharacterString>\r\n              </gmd:codeSpace>\r\n            </gmd:RS_Identifier>\r\n          </gmd:identifier>\r\n        </gmd:CI_Citation>\r\n      </gmd:citation>\r\n      <gmd:abstract>\r\n        <gco:CharacterString>Ce service de téléchargement ATOM Feed donne accès aux couches de données identifiée dans le thème INSPIRE "Occupation des terres" au sein du territoire wallon (Belgique).\r\n\r\nCe service de téléchargement simple est fourni par le Service public de Wallonie (SPW) et permet le téléchargement direct des couches de données géographiques identifiées comme faisant partie du thème "Occupation des terres" de la Directive INSPIRE (Annexe 2.2) sur l'ensemble du territoire wallon. Il utilise la technologie de flux de données ATOM Feed.\r\n\r\nLe service est conforme aux spécifications de la Directive INSPIRE en la matière.\r\n\r\nCe service de téléchargement simple permet d’accéder en téléchargement aux couches de données présentées "telles quelles", c'est-à-dire dans leur modèle de données initial, non conforme aux spécifications de données définies par la Directive. Les couches de données seront progressivement adaptées aux modèles de donnée commun INSPIRE suivant les spécifications du thème. \r\n\r\nLe service propose les opérations suivantes :\r\n- Accéder aux métadonnées du service de téléchargement;\r\n- Décrire les couches de données géographiques relative au thème "Occupation des terres";\r\n- Accéder aux couches de données géographiques relatives au thème "Occupation des terres".</gco:CharacterString>\r\n      </gmd:abstract>\r\n      <gmd:pointOfContact>\r\n        <gmd:CI_ResponsibleParty>\r\n          <gmd:organisationName>\r\n            <gco:CharacterString>Helpdesk carto du SPW (SPW - Secrétariat général - SPW Digital - Département de la Géomatique - Direction de l'Intégration des géodonnées)</gco:CharacterString>\r\n          </gmd:organisationName>\r\n          <gmd:contactInfo>\r\n            <gmd:CI_Contact>\r\n              <gmd:address>\r\n                <gmd:CI_Address>\r\n                  <gmd:electronicMailAddress>\r\n                    <gco:CharacterString>helpdesk.carto@spw.wallonie.be</gco:CharacterString>\r\n                  </gmd:electronicMailAddress>\r\n                </gmd:CI_Address>\r\n              </gmd:address>\r\n            </gmd:CI_Contact>\r\n          </gmd:contactInfo>\r\n          <gmd:role>\r\n            <gmd:CI_RoleCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_RoleCode" codeListValue=