\n              <gmd:codeSpace>\r\n                <gco:CharacterString>BE.SPW.INFRASIG.CARTON</gco:CharacterString>\r\n              </gmd:codeSpace>\r\n            </gmd:RS_Identifier>\r\n          </gmd:identifier>\r\n        </gmd:CI_Citation>\r\n      </gmd:citation>\r\n      <gmd:abstract>\r\n        <gco:CharacterString>Cette couche de données localise les Services de médiation de dettes (SMD) agréés, et les Centres de références en médiation de dettes, sur le territoire de la Wallonie.\r\n\r\nLes services de médiation de dettes aident gratuitement le citoyen à trouver une solution à ses dettes via un plan global d’apurement de ses dettes négocié avec les créanciers.\r\nIls œuvrent :\r\n-\tsoit dans un contexte amiable en cherchant à obtenir l'accord de toutes les parties (personne endettée et créanciers) sur un aménagement du paiement de la dette,\r\n-\tsoit dans un cadre judiciaire (règlement collectif de dettes), après admissibilité d'une requête introduite en ce sens auprès du greffe du Tribunal du Travail compétent. Cet accord peut être recherché de marnière amiable ou, à défaut, imposé par le Juge.\r\nAprès signature d'une convention (par laquelle la personne s'engage notamment à collaborer avec le service et à lui fournir toute l'information utile), le travailleur social du service de médiation de dettes, assisté des compétences d'un juriste, va mettre en parallèle les ressources de la personne en difficulté et ses engagements financiers pour établir un plan de remboursement des dettes tout en préservant des conditions de vie décentes. Le service assistera également la personne dans la rédaction d'une requête en vue de l'introduction d'une demande de règlement collectif de dettes. Il peut également être désigné par le Juge du Tribunal du travail pour l'établissement, le suivi et le contrôle de l'exécution du plan de règlement amiable ou imposé.\r\nLes services de médiation de dettes mènent également des actions de prévention du surendettement en organisant des Groupes d'appui pour la prévention du surendettement. Ces groupes sont des espaces de parole où les personnes surendettées ou intéressées par la gestion budgétaire échangent leur point de vue et leur expérience avec l'aide d'un animateur, sur différentes thématiques (par exemple, sur le budget, les pièges à la consommation, la sécurité sociale, etc.).</gco:CharacterString>\r\n      </gmd:abstract>\r\n      <gmd:status>\r\n        <gmd:MD_ProgressCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#MD_ProgressCode" codeListValue="planned">planned</gmd:MD_ProgressCode>\r\n      </gmd:status>\r\n      <gmd:pointOfContact>\r\n        <gmd:CI_ResponsibleParty>\r\n          <gmd:organisationName>\r\n            <gco:CharacterString>Direction de l'Action sociale (SPW - Intérieur et Action sociale - Département de l'Action sociale - Direction de l'Action sociale)</gco:CharacterString>\r\n          </gmd:organisationName>\r\n          <gmd:contactInfo>\r\n            <gmd:CI_Contact>\r\n              <gmd:address>\r\n                <gmd:CI_Address>\r\n                  <gmd:electronicMailAddress>\r\n                    <gco:CharacterString>smd.dgo5@spw.wallonie.be</gco:CharacterString>\r\n                  </gmd:electronicMailAddress>\r\n                </gmd:CI_Address>\r\n              </gmd:address>\r\n            </gmd:CI_Contact>\r\n          </gmd:contactInfo>\r\n          <gmd:role>\r\n            <gmd:CI_RoleCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_RoleCode" codeListValue="pointOfContact">pointOfContact</gmd:CI_RoleCode>\r\n          </gmd:role>\r\n        </gmd:CI_ResponsibleParty>\r\n      </gmd:pointOfContact>\r\n      <gmd:pointOfContact>\r\n        <gmd:CI_ResponsibleParty>\r\n          <gmd:organisationName>\r\n            <gco:CharacterString>Cellule informatique et géomatique (SPW - Intérieur et Action sociale - Direction fonctionnelle et d’appui)</gco:CharacterString>\r\n          </gmd