725	<gmd:MD_Metadata xmlns:gmd="http://www.isotc211.org/2005/gmd" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns:gco="http://www.isotc211.org/2005/gco" xmlns:srv="http://www.isotc211.org/2005/srv" xmlns:gmx="http://www.isotc211.org/2005/gmx" xmlns:gts="http://www.isotc211.org/2005/gts" xmlns:gsr="http://www.isotc211.org/2005/gsr" xmlns:gmi="http://www.isotc211.org/2005/gmi" xmlns:gml="http://www.opengis.net/gml/3.2" xmlns:xlink="http://www.w3.org/1999/xlink">\r\n  <gmd:fileIdentifier>\r\n    <gco:CharacterString>01491630-78ce-49f3-b479-4b30dabc4c69</gco:CharacterString>\r\n  </gmd:fileIdentifier>\r\n  <gmd:language>\r\n    <gmd:LanguageCode codeList="http://www.loc.gov/standards/iso639-2/" codeListValue="fre" />\r\n  </gmd:language>\r\n  <gmd:characterSet>\r\n    <gmd:MD_CharacterSetCode codeListValue="utf8" codeList="http://www.isotc211.org/namespace/resources/codeList.xml#MD_CharacterSetCode" />\r\n  </gmd:characterSet>\r\n  <gmd:hierarchyLevel>\r\n    <gmd:MD_ScopeCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#MD_ScopeCode" codeListValue="series" />\r\n  </gmd:hierarchyLevel>\r\n  <gmd:hierarchyLevelName>\r\n    <gco:CharacterString>Série de couches de données thématiques</gco:CharacterString>\r\n  </gmd:hierarchyLevelName>\r\n  <gmd:contact>\r\n    <gmd:CI_ResponsibleParty>\r\n      <gmd:organisationName>\r\n        <gco:CharacterString>Agence wallonne du Patrimoine (SPW - Territoire, Logement, Patrimoine, Énergie - Agence wallonne du Patrimoine)</gco:CharacterString>\r\n      </gmd:organisationName>\r\n      <gmd:contactInfo>\r\n        <gmd:CI_Contact>\r\n          <gmd:address>\r\n            <gmd:CI_Address>\r\n              <gmd:electronicMailAddress>\r\n                <gco:CharacterString>coordination@awap.be</gco:CharacterString>\r\n              </gmd:electronicMailAddress>\r\n            </gmd:CI_Address>\r\n          </gmd:address>\r\n        </gmd:CI_Contact>\r\n      </gmd:contactInfo>\r\n      <gmd:role>\r\n        <gmd:CI_RoleCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_RoleCode" codeListValue="pointOfContact">pointOfContact</gmd:CI_RoleCode>\r\n      </gmd:role>\r\n    </gmd:CI_ResponsibleParty>\r\n  </gmd:contact>\r\n  <gmd:dateStamp>\r\n    <gco:DateTime>2023-05-17T19:01:01</gco:DateTime>\r\n  </gmd:dateStamp>\r\n  <gmd:metadataStandardName>\r\n    <gco:CharacterString>ISO 19115</gco:CharacterString>\r\n  </gmd:metadataStandardName>\r\n  <gmd:metadataStandardVersion>\r\n    <gco:CharacterString>2003/Cor 1:2006</gco:CharacterString>\r\n  </gmd:metadataStandardVersion>\r\n  <gmd:referenceSystemInfo>\r\n    <gmd:MD_ReferenceSystem>\r\n      <gmd:referenceSystemIdentifier>\r\n        <gmd:RS_Identifier>\r\n          <gmd:code>\r\n            <gmx:Anchor xlink:href="http://www.opengis.net/def/crs/EPSG/0/31370">EPSG:31370</gmx:Anchor>\r\n          </gmd:code>\r\n        </gmd:RS_Identifier>\r\n      </gmd:referenceSystemIdentifier>\r\n    </gmd:MD_ReferenceSystem>\r\n  </gmd:referenceSystemInfo>\r\n  <gmd:identificationInfo>\r\n    <gmd:MD_DataIdentification>\r\n      <gmd:citation>\r\n        <gmd:CI_Citation>\r\n          <gmd:title>\r\n            <gco:CharacterString>Patrimoine - Biens classés et zones de protection - Série</gco:CharacterString>\r\n          </gmd:title>\r\n          <gmd:alternateTitle>\r\n            <gco:CharacterString>BC_PAT</gco:CharacterString>\r\n          </gmd:alternateTitle>\r\n          <gmd:date>\r\n            <gmd:CI_Date>\r\n              <gmd:date>\r\n                <gco:Date>2023-05-17</gco:Date>\r\n              </gmd:date>\r\n              <gmd:dateType>\r\n                <gmd:CI_DateTypeCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_DateTypeCode" codeListValue="revision">revision</gmd:CI_DateTypeCode>\r\n              </gmd:dateType>\r\n            </gmd:CI_Date>\r\n          </gmd:date>\r\n          <gmd:date>\r\n            <gmd:CI_Date>\r\n              <gmd:date>\r\n                <gco:Date>2023-02-14</gco:Date>\r\n              </gmd:date>\r\n              <gmd:dateType>\r\n                <gmd:CI_DateTypeCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_DateTypeCode" codeListValue="publication">publication</gmd:CI_DateTypeCode>\r\n              </gmd:dateType>\r\n            </gmd:CI_Date>\r\n          </gmd:date>\r\n          <gmd:identifier>\r\n            <gmd:RS_Identifier>\r\n              <gmd:code>\r\n                <gco:CharacterString>01491630-78ce-49f3-b479-4b30dabc4c69</gco:CharacterString>\r\n              </gmd:code>\r\n              <gmd:codeSpace>\r\n                <gco:CharacterString>http://geodata.wallonie.be/id/</gco:CharacterString>\r\n              </gmd:codeSpace>\r\n            </gmd:RS_Identifier>\r\n          </gmd:identifier>\r\n          <gmd:identifier>\r\n            <gmd:RS_Identifier>\r\n              <gmd:code>\r\n                <gco:CharacterString>DATLPE__BC_PAT</gco:CharacterString>\r\n              </gmd:code>\r\n              <gmd:codeSpace>\r\n                <gco:CharacterString>BE.SPW.INFRASIG.CARTON</gco:CharacterString>\r\n              </gmd:codeSpace>\r\n            </gmd:RS_Identifier>\r\n          </gmd:identifier>\r\n        </gmd:CI_Citation>\r\n      </gmd:citation>\r\n      <gmd:abstract>\r\n        <gco:CharacterString>Cette série de couches de données reprend la localisation des différents biens classés en Région wallonne.\r\n\r\nLe classement constitue une mesure de protection légale d’un bien immobilier dont la valeur patrimoniale supérieure est ainsi reconnue et dont la conservation est jugée d’intérêt régional. Cette exigence de conservation inclut l’entretien du bien et, si nécessaire, sa restauration au moyen de procédés et techniques spécifiques déterminés en fonction de ses qualités propres. Le classement est consacré par un arrêté du gouvernement wallon.\r\n\r\nLe classement porte uniquement sur des biens immobiliers situés sur le territoire de la Région wallonne (sauf dans les communes germanophones où ces matières sont gérées par la communauté germanophone) et qui présentent un intérêt architectural, historique, archéologique, scientifique, artistique, social, technique, mémoriel, esthétique, urbanistique ou paysager, dont le degré supérieur est analysé sur base des critères d’authenticité, d’intégrité, de représentativité typologique ou de rareté.\r\n\r\nUne distinction est apportée au niveau du classement en fonction de la nature du bien concerné : on le classera comme monument, site, ensemble architectural ou site archéologique (CoPat - art.3, 7°). Ces biens constituent autant de couches géographiques identifiés dans la présente collection. Les monuments constituent des entités ponctuelles et les autres biens des entités zonales.\r\n\r\nLe CoPat considère :\r\n- à titre de monument : toute réalisation architecturale, sculpturale ou végétale isolée et remarquable, en ce compris les éléments immobilisés par incorporation ou destination et les biens culturels qui en font partie intégrante, notamment l’équipement complémentaire et les éléments décoratifs. Pour les monuments, des subsides peuvent être octroyés pour les travaux ou études visant à protéger, restaurer ou mettre en valeur le bien;\r\n- à titre d’ensemble architectural : tout groupement de constructions, en ce compris les éléments qui les relient, remarquable par sa cohérence ou par son intégration dans le paysage;\r\n- à titre de site : toute œuvre de la nature ou toute œuvre combinée de l’homme et de la nature constituant un espace remarquable au regard d’un ou plusieurs critères visés à l’article 1er du CoPat, suffisamment caractéristique et cohérent pour faire l’objet d’une délimitation topographique;\r\n- à titre de site archéologique : tout terrain, formation géologique ou pédologique, bâtiment, ensemble de bâtiment ou site ayant recelé, recelant ou étant présumé receler des biens archéologiques.\r\n\r\nAfin de garantir la qualité de l’environnement du bien classé, une zone de protection est établie dans certains cas.\r\n\r\nLa procédure de classement d'un bien patrimonial étant relativement longue, une procédure spécifique est prévue lorsqu’un bien nécessite une protection en urgence : l’inscription sur la liste de sauvegarde. Pour plus de renseignements, consultez la fiche de métadonnées relative à la Liste de sauvegarde (PAT_LSTSAV).\r\n\r\nParmi les nombreux biens protégés de Wallonie, un certain nombre présente un intérêt majeur. Ils sont repris dans la liste du patrimoine exceptionnel de la Région wallonne. Ces biens alimentent également la liste du patrimoine mondial (UNESCO). Pour plus de renseignements, consultez les fiches de métadonnées relatives aux Biens exceptionnels (PAT_EXC) et aux Biens mondiaux (PAT_MND).\r\n\r\nChaque bien classé est identifié de manière unique, ce qui permet la liaison entre les éléments cartographiés et la base de données documentaire reprenant des informations administratives ainsi que les documents scannés relevés dans les dossiers liés.</gco:CharacterString>\r\n      </gmd:abstract>\r\n      <gmd:status>\r\n        <gmd:MD_ProgressCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#MD_ProgressCode" codeListValue="onGoing">onGoing</gmd:MD_ProgressCode>\r\n      </gmd:status>\r\n      <gmd:pointOfContact>\r\n        <gmd:CI_ResponsibleParty>\r\n          <gmd:organisationName>\r\n            <gco:CharacterString>Helpdesk carto du SPW (SPW - Secrétariat général - SPW Digital - Département de la Géomatique - Direction de l'Intégration des géodonnées)</gco:CharacterString>\r\n          </gmd:organisationName>\r\n          <gmd:contactInfo>\r\n            <gmd:CI_Contact>\r\n              <gmd:address>\r\n                <gmd:CI_Address>\r\n                  <gmd:electronicMailAddress>\r\n                    <gco:CharacterString>helpdesk.carto@spw.wallonie.be</gco:CharacterString>\r\n                  </gmd:electronicMailAddress>\r\n                </gmd:CI_Address>\r\n              </gmd:address>\r\n            </gmd:CI_Contact>\r\n          </gmd:contactInfo>\r\n          <gmd:role>\r\n            <gmd:CI_RoleCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_RoleCode" codeListValue="pointOfContact">pointOfContact</gmd:CI_RoleCode>\r\n          </gmd:role>\r\n        </gmd:CI_ResponsibleParty>\r\n      </gmd:pointOfContact>\r\n      <gmd:pointOfContact>\r\n        <gmd:CI_ResponsibleParty>\r\n          <gmd:organisationName>\r\n            <gco:CharacterString>Agence wallonne du Patrimoine (SPW - Territoire, Logement, Patrimoine, Énergie - Agence wallonne du Patrimoine)</gco:CharacterString>\r\n          </gmd:organisationName>\r\n          <gmd:contactInfo>\r\n            <gmd:CI_Contact>\r\n              <gmd:address>\r\n                <gmd:CI_Address>\r\n                  <gmd:electronicMailAddress>\r\n                    <gco:CharacterString>coordination@awap.be</gco:CharacterString>\r\n                  </gmd:electronicMailAddress>\r\n                </gmd:CI_Address>\r\n              </gmd:address>\r\n            </gmd:CI_Contact>\r\n          </gmd:contactInfo>\r\n          <gmd:role>\r\n            <gmd:CI_RoleCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_RoleCode" codeListValue="custodian">custodian</gmd:CI_RoleCode>\r\n          </gmd:role>\r\n        </gmd:CI_ResponsibleParty>\r\n      </gmd:pointOfContact>\r\n      <gmd:pointOfContact>\r\n        <gmd:CI_ResponsibleParty>\r\n          <gmd:organisationName>\r\n            <gco:CharacterString>Service public de Wallonie (SPW)</gco:CharacterString>\r\n          </gmd:organisationName>\r\n          <gmd:contactInfo>\r\n            <gmd:CI_Contact>\r\n              <gmd:address>\r\n                <gmd:CI_Address />\r\n              </gmd:address>\r\n              <gmd:onlineResource>\r\n                <gmd:CI_OnlineResource>\r\n                  <gmd:l