ntact>\r\n      </gmd:contactInfo>\r\n      <gmd:role>\r\n        <gmd:CI_RoleCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_RoleCode" codeListValue="pointOfContact" />\r\n      </gmd:role>\r\n    </gmd:CI_ResponsibleParty>\r\n  </gmd:contact>\r\n  <gmd:dateStamp>\r\n    <gco:DateTime>2024-05-03T13:35:48.091Z</gco:DateTime>\r\n  </gmd:dateStamp>\r\n  <gmd:metadataStandardName>\r\n    <gco:CharacterString>ISO 19115:2003/19139</gco:CharacterString>\r\n  </gmd:metadataStandardName>\r\n  <gmd:metadataStandardVersion>\r\n    <gco:CharacterString>1.0</gco:CharacterString>\r\n  </gmd:metadataStandardVersion>\r\n  <gmd:identificationInfo>\r\n    <gmd:MD_DataIdentification>\r\n      <gmd:citation>\r\n        <gmd:CI_Citation>\r\n          <gmd:title>\r\n            <gco:CharacterString>SCoT (Schéma de cohérence territoriale) en région Hauts-de-France</gco:CharacterString>\r\n          </gmd:title>\r\n          <gmd:date>\r\n            <gmd:CI_Date>\r\n              <gmd:date>\r\n                <gco:Date>2021-02-17</gco:Date>\r\n              </gmd:date>\r\n              <gmd:dateType>\r\n                <gmd:CI_DateTypeCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_DateTypeCode" codeListValue="creation" />\r\n              </gmd:dateType>\r\n            </gmd:CI_Date>\r\n          </gmd:date>\r\n          <gmd:date>\r\n            <gmd:CI_Date>\r\n              <gmd:date>\r\n                <gco:Date>2023-03-06</gco:Date>\r\n              </gmd:date>\r\n              <gmd:dateType>\r\n                <gmd:CI_DateTypeCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_DateTypeCode" codeListValue="revision" />\r\n              </gmd:dateType>\r\n            </gmd:CI_Date>\r\n          </gmd:date>\r\n          <gmd:edition gco:nilReason="missing">\r\n            <gco:CharacterString />\r\n          </gmd:edition>\r\n          <gmd:identifier>\r\n            <gmd:MD_Identifier>\r\n              <gmd:code>\r\n                <gco:CharacterString>fr-200053742/2021/scot</gco:CharacterString>\r\n              </gmd:code>\r\n            </gmd:MD_Identifier>\r\n          </gmd:identifier>\r\n        </gmd:CI_Citation>\r\n      </gmd:citation>\r\n      <gmd:abstract>\r\n        <gco:CharacterString>Le SCoT (Schéma de Cohérence Territoriale) est régi par le code de l'urbanisme (articles L et R.141-1 et suivants). C’est un document d'urbanisme déterminant à l’échelle de plusieurs communes ou groupements de communes, un projet de territoire visant à mettre en cohérence l'ensemble des politiques sectorielles, notamment pour l’habitat, la mobilité, l’aménagement commercial, l’environnement et le paysage.\r\n\r\nLa donnée sur les SCoT se décompose en 3 données distinctes :\r\n- scot_approuves : SCoT approuvés et opposables. Le périmètre correspond au périmètre du document approuvé.\r\n\r\n- scot_en_cours : Scot en cours d’élaboration ou de révision. Tout changement apporté à un SCoT crée une nouvelle version qui vient remplacer la précédente. Ainsi, un SCoT en révision peut avoir un périmètre différent du périmètre du précédent document approuvé.\r\n\r\n- scot_archives : SCoT remplacé, annulé ou caduc. Tout changement apporté à un SCoT crée une nouvelle version qui vient remplacer la précédente. Ainsi, un SCoT en révision (préalablement dans la couche scot_en_cours) qui se retrouve approuvé et opposable passe donc dans la couche scot_approuves. Le SCoT qui est remplacé par ce nouveau passe quant à lui dans la couche scot_archives. Il en est de même pour un SCoT annulé ou caduc (plus de détails dans le dictionnaire d'attributs ci-dessous).\r\n\r\nLes données produites s'appuient sur le modèle CNIG de juin 2018 relatif aux SCoT : \r\nhttp://cnig.gouv.fr/wp-content/uploads/2019/04/190315_Standard_CNIG_SCOT.pdf\r\n\r\n! La structure a été modifiée au 03/2023 pour prendre en compte les évolutions du modèle CNIG du 10/06/2021 : \r\nhttp://cnig.gouv.fr/IMG/pdf/210615_standard_cnig_nouveauscot.pdf\r\n(il coexiste donc dans le modèle des champs liés aux deux modèles, par exemple sur les PADD pour les "anciens" SCoT, ou encore sur les PAS ou les DAAC pour les "nouveaux" SCoT)\r\n\r\nPlus d'information sur : \r\nhttps://www.legifrance.gouv.fr/codes/section_lc/LEGITEXT000006074075/LEGISCTA000031210896/#LEGISCTA000031212094\r\net sur\r\nhttp://cnig.gouv.fr/ressources-dematerialisation-documents-d-urbanisme-a2732.html</gco:CharacterString>\r\n      </gmd:abstract>\r\n      <gmd:status>\r\n        <gmd:MD_ProgressCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#MD_ProgressCode" codeListValue="onGoing" />\r\n      </gmd:status>\r\n      <gmd:pointOfContact>\r\n        <gmd:CI_ResponsibleParty>\r\n          <gmd:organisationName>\r\n            <gco:CharacterString>Région Hauts-de-France</gco:CharacterString>\r\n          </gmd:organisationName>\r\n          <gmd:contactInfo>\r\n            <gmd:CI_Contact>\r\n              <gmd:address>\r\n                <gmd:CI_Address>\r\n                  <gmd:electronicMailAddress>\r\n                    <gco:CharacterString>opendata@hautsdefrance.fr</gco:CharacterString>\r\n                  </gmd:electronicMailAddress>\r\n                </gmd:CI_Address>\r\n              </gmd:address>\r\n            </gmd:CI_Contact>\r\n          </gmd:contactInfo>\r\n          <gmd:role>\r\n            <gmd:CI_RoleCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_RoleCode" codeListValue="pointOfContact" />\r\n          </gmd:role>\r\n        </gmd:CI_ResponsibleParty>\r\n      </gmd:pointOfContact>\r\n      <gmd:graphicOverview>\r\n        <gmd:MD_BrowseGraphic>\r\n          <gmd:fileName>\r\n            <gco:CharacterString>https://geocatalogue.hautsdefrance.fr/geonetwork/srv/api/records/ee965118-2416-4d48-b07e-bbc696f002c2/attachments/Scot_21.JPG</gco:CharacterString>\r\n          </gmd:fileName>\r\n          <gmd:fileDescription>\r\n            <gc