md:languageCode>\r\n        <gmd:LanguageCode codeList="" codeListValue="ara" />\r\n      </gmd:languageCode>\r\n      <gmd:characterEncoding>\r\n        <gmd:MD_CharacterSetCode codeList="" codeListValue="" />\r\n      </gmd:characterEncoding>\r\n    </gmd:PT_Locale>\r\n  </gmd:locale>\r\n  <gmd:locale>\r\n    <gmd:PT_Locale id="ES">\r\n      <gmd:languageCode>\r\n        <gmd:LanguageCode codeList="" codeListValue="spa" />\r\n      </gmd:languageCode>\r\n      <gmd:characterEncoding>\r\n        <gmd:MD_CharacterSetCode codeList="" codeListValue="" />\r\n      </gmd:characterEncoding>\r\n    </gmd:PT_Locale>\r\n  </gmd:locale>\r\n  <gmd:locale>\r\n    <gmd:PT_Locale id="RU">\r\n      <gmd:languageCode>\r\n        <gmd:LanguageCode codeList="" codeListValue="rus" />\r\n      </gmd:languageCode>\r\n      <gmd:characterEncoding>\r\n        <gmd:MD_CharacterSetCode codeList="" codeListValue="" />\r\n      </gmd:characterEncoding>\r\n    </gmd:PT_Locale>\r\n  </gmd:locale>\r\n  <gmd:referenceSystemInfo>\r\n    <gmd:MD_ReferenceSystem>\r\n      <gmd:referenceSystemIdentifier>\r\n        <gmd:RS_Identifier>\r\n          <gmd:code>\r\n            <gco:CharacterString>WGS 1984</gco:CharacterString>\r\n          </gmd:code>\r\n        </gmd:RS_Identifier>\r\n      </gmd:referenceSystemIdentifier>\r\n    </gmd:MD_ReferenceSystem>\r\n  </gmd:referenceSystemInfo>\r\n  <gmd:identificationInfo>\r\n    <gmd:MD_DataIdentification>\r\n      <gmd:citation>\r\n        <gmd:CI_Citation>\r\n          <gmd:title xsi:type="gmd:PT_FreeText_PropertyType">\r\n            <gco:CharacterString>Template for Vector data in ISO19139 (multilingual)</gco:CharacterString>\r\n            <gmd:PT_FreeText>\r\n              <gmd:textGroup>\r\n                <gmd:LocalisedCharacterString locale="#FR">Modèle de données vectorielles en\r\n                  ISO19139 (multilingue)</gmd:LocalisedCharacterString>\r\n              </gmd:textGroup>\r\n              <gmd:textGroup>\r\n                <gmd:LocalisedCharacterString locale="#DE">Vorlage für die Vektor-Daten in ISO19139\r\n                  (mehrsprachig)</gmd:LocalisedCharacterString>\r\n              </gmd:textGroup>\r\n              <gmd:textGroup>\r\n                <gmd:LocalisedCharacterString locale="#ES">De plantilla para el vector de datos en\r\n                  ISO19139 (multilingüe)</gmd:LocalisedCharacterString>\r\n              </gmd:textGroup>\r\n              <gmd:textGroup>\r\n                <gmd:LocalisedCharacterString locale="#RU">Шаблон для векторных данных в ISO19139\r\n                  (многоязычное)</gmd:LocalisedCharacterString>\r\n              </gmd:textGroup>\r\n              <gmd:textGroup>\r\n                <gmd:LocalisedCharacterString locale="#AR">نموذج البيانات الموجهة في ISO19139\r\n                  (متعددة اللغات)</gmd:LocalisedCharacterString>\r\n              </gmd:textGroup>\r\n              <gmd:textGroup>\r\n                <gmd:LocalisedCharacterString locale="#ZH">模板矢量数据ISO19139（多种语言）</gmd:LocalisedCharacterString>\r\n              </gmd:textGroup>\r\n            </gmd:PT_FreeText>\r\n          </gmd:title>\r\n          <gmd:date>\r\n            <gmd:CI_Date>\r\n              <gmd:date>\r\n                <gco:DateTime />\r\n              </gmd:date>\r\n              <gmd:dateType>\r\n                <gmd:CI_DateTypeCode codeListValue="publication" codeList="http://www.isotc211.org/2005/resources/codeList.xml#CI_DateTypeCode" />\r\n              </gmd:dateType>\r\n            </gmd:CI_Date>\r\n          </gmd:date>\r\n          <gmd:edition gco:nilReason="missing">\r\n            <gco:CharacterString />\r\n          </gmd:edition>\r\n          <gmd:presentationForm>\r\n            <gmd:CI_PresentationFormCode codeListValue="mapDigital" codeList="http://www.isotc211.org/2005/resources/codeList.xml#CI_PresentationFormCode" />\r\n          </gmd:presentationForm>\r\n        </gmd:CI_Citation>\r\n      </gmd:citation>\r\n      <gmd:abstract xsi:type="gmd:PT_FreeText_PropertyType">\r\n        <gco:CharacterString>The ISO19115 metadata standard is the preferred metadata standard to\r\n          use. This template is multilingual with a default language set to english. Other language\r\n          could be used to translate part of the metadata record. Main language is define in\r\n          metadata section. Other languages could be added to metadata section / locale element.</gco:CharacterString>\r\n        <gmd:PT_FreeText>\r\n          <gmd:textGroup>\r\n            <gmd:LocalisedCharacterString locale="#ZH">元数据标准的ISO19115是首选元数据标准使用。这个模板是多语种的默认语言设置为英语。其他语言可以用来翻译部分的元数据记录。主要语言是界定元一节。其他语言可以增加元数据节/地区因素。</gmd:LocalisedCharacterString>\r\n          </gmd:textGroup>\r\n          <gmd:textGroup>\r\n            <gmd:LocalisedCharacterString locale="#AR">فإن معيار ISO19115 الفوقية هو المفضل\r\n              لاستخدام البيانات الوصفية القياسية. هذا القالب هو متعدد اللغات مع اللغة الافتراضية\r\n              لمجموعة الانجليزية. لغة أخرى يمكن استخدامها لتحويل جزء من الفوقية. اللغة الرئيسية هي\r\n              تحديد الفوقية في هذا الباب. لغات أخرى يمكن أن تضاف إلى الباب الفوقية / عنصر المكان.</gmd:LocalisedCharacterString>\r\n          </gmd:textGroup>\r\n          <gmd:textGroup>\r\n            <gmd:LocalisedCharacterString locale="#RU">В метаданных стандарта ISO19115\r\n              предпочтительным является стандарт метаданных для использования. Этот шаблон\r\n              многоязычный с языком по умолчанию установлен на английском языке. Другие языки могут\r\n              использоваться для перевода части метаданных записи. Основным языком является\r\n              определение метаданных разделе. Другие языки могут быть добавлены метаданные раздел /\r\n              локаль элемент.</gmd:LocalisedCharacterString>\r\n          </gmd:textGroup>\r\n          <gmd:textGroup>\r\n            <gmd:LocalisedCharacterString locale="#ES">El estándar de metadatos ISO19115 es el\r\n              estándar de metadatos a utilizar. Esta plantilla es multilingüe, con un idioma por\r\n              defecto configurado en Inglés. En otros idiomas puede ser usado para traducir parte\r\n              del registro de metadatos. Idioma principal es definir los metadatos en la sección.\r\n              Otros idiomas pueden ser añadidos a la sección de metadatos / locale elemento.</gmd:LocalisedCharacterString>\r\n          </gmd:textGroup>\r\n          <gmd:textGroup>\r\n            <gmd:LocalisedCharacterString locale="#DE">Die ISO19115 Metadaten-Standard ist der\r\n              bevorzugte Metadaten-Standard zu verwenden. Diese Vorlage ist mehrsprachig mit einer\r\n              Standard-Sprache auf Englisch. Andere Sprache verwendet werden könnten, um Teil der\r\n              Metadaten werden. Sprache definieren, ist in Abschnitt Metadaten. Weitere Sprachen\r\n              können hinzugefügt werden, um Metadaten Abschnitt / locale Element.</gmd:LocalisedCharacterString>\r\n          </gmd:textGroup>\r\n          <gmd:textGroup>\r\n            <gmd:LocalisedCharacterString locale="#FR">La norme de métadonnées ISO19115 est la\r\n              norme de métadonnées à utiliser. Ce modèle est multilingue avec une langue par défaut\r\n              en anglais. D'autres langues pourraient être utilisées pour traduire une partie de la\r\n              de métadonnées. La langue principale est de définir dans la section des métadonnées.\r\n              D'autres langues pourraient être ajoutées à la section des métadonnées / locale\r\n              élément.</gmd:LocalisedCharacterString>\r\n          </gmd:textGroup>\r\n        </gmd:PT_FreeText>\r\n      </gmd:abstract>\r\n      <gmd:purpose gco:nilReason="missing">\r\n        <gco:CharacterString />\r\n      </gmd:purpose>\r\n      <gmd:status>\r\n        <gmd:MD_ProgressCode codeListValue="onGoing" codeList="http://www.isotc211.org/2005/resources/codeList.xml#MD_ProgressCode" />\r\n      </gmd:status>\r\n      <gmd:pointOfContact>\r\n        <gmd:CI_ResponsibleParty>\r\n   