.xml#MD_GeometricObjectTypeCode" codeListValue="point" />\r\n          </gmd:geometricObjectType>\r\n          <gmd:geometricObjectCount>\r\n            <gco:Integer>2503</gco:Integer>\r\n          </gmd:geometricObjectCount>\r\n        </gmd:MD_GeometricObjects>\r\n      </gmd:geometricObjects>\r\n    </gmd:MD_VectorSpatialRepresentation>\r\n  </gmd:spatialRepresentationInfo>\r\n  <gmd:referenceSystemInfo xmlns:xl="http://www.w3.org/1999/xlink">\r\n    <gmd:MD_ReferenceSystem>\r\n      <gmd:referenceSystemIdentifier>\r\n        <gmd:RS_Identifier>\r\n          <gmd:code>\r\n            <gmx:Anchor xl:href="http://www.opengis.net/def/crs/EPSG/0/2154">EPSG:2154</gmx:Anchor>\r\n          </gmd:code>\r\n        </gmd:RS_Identifier>\r\n      </gmd:referenceSystemIdentifier>\r\n    </gmd:MD_ReferenceSystem>\r\n  </gmd:referenceSystemInfo>\r\n  <gmd:identificationInfo xmlns:xl="http://www.w3.org/1999/xlink">\r\n    <gmd:MD_DataIdentification>\r\n      <gmd:citation>\r\n        <gmd:CI_Citation>\r\n          <gmd:title>\r\n            <gco:CharacterString>Zones de collecte de déchets en porte à porte - par flux de collecte, jour et horaire de tournée</gco:CharacterString>\r\n          </gmd:title>\r\n          <gmd:alternateTitle gco:nilReason="missing">\r\n            <gco:CharacterString />\r\n          </gmd:alternateTitle>\r\n          <gmd:date>\r\n            <gmd:CI_Date>\r\n              <gmd:date>\r\n                <gco:Date>2024-04-26</gco:Date>\r\n              </gmd:date>\r\n              <gmd:dateType>\r\n                <gmd:CI_DateTypeCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_DateTypeCode" codeListValue="revision" />\r\n              </gmd:dateType>\r\n            </gmd:CI_Date>\r\n          </gmd:date>\r\n          <gmd:date>\r\n            <gmd:CI_Date>\r\n              <gmd:date>\r\n                <gco:Date>2023-10-20</gco:Date>\r\n              </gmd:date>\r\n              <gmd:dateType>\r\n                <gmd:CI_DateTypeCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_DateTypeCode" codeListValue="creation" />\r\n              </gmd:dateType>\r\n            </gmd:CI_Date>\r\n          </gmd:date>\r\n          <gmd:identifier>\r\n            <gmd:MD_Identifier>\r\n              <gmd:code>\r\n                <gco:CharacterString>20d90d3b-64a4-4777-bfb6-7da3b48eb421</gco:CharacterString>\r\n              </gmd:code>\r\n            </gmd:MD_Identifier>\r\n          </gmd:identifier>\r\n        </gmd:CI_Citation>\r\n      </gmd:citation>\r\n      <gmd:abstract>\r\n        <gco:CharacterString>La collecte des déchets ménagers et assimilés est principalement assurée en porte à porte sur le territoire de la Métropole Européenne de Lille (MEL).\r\n\r\nCe jeu de données présente :\r\n* les zones correspondant à chaque tournée de collecte,\r\n* les flux de déchets collectés,\r\n* le jour et l'heure de la collecte (au format OSM Opening Hours).\r\n\r\nChaque tournée de collecte présente un identifiant métier unique. La motivation principale pour la création de ce jeu de données a été la possibilité d’interroger les horaires et déchets collectés par la géographie et pas par adresse. \r\n    \r\n### Contexte \r\nLes tournées de collecte en porte à porte sont évolution constante sur le territoire. \r\n* D'une part, depuis la création de l'intercommunalité, le périmètre de la MEL a fortement évolué au gré de l'intégration de nouvelles communes ou de leur fusion. Début 2017, une première modification a lieu avec l'adhésion des communes appartenant auparavant à la Communauté de Communes des Weppes, suivie en mars 2020 par celles de la Communauté de Communes de la Haute-Deûle. Ces anciennes intercommunalités avaient mis en place une organisation du tri et de la collecte des déchets ménagers et assimilés et des prestataires différents de ceux de la MEL. L'objectif de long terme reste l'harmonisation des méthodes de collecte à l'échelle métropolitaine.\r\n \r\n* D'autre part, de nouveau mode de collecte sont apparus ou ont été renforcés, avec par exemple l'installation progressive des Points d'Apport Volontaire, l'Extension des Consignes de Tri ou l'implantation du tri à la source des biodéchets. Ces dynamiques plus récentes modifient en détail et au cas par cas la collecte en fonction du lieu de résidence du producteur de déchets. \r\n\r\n* Enfin, les prestataires de collecte mettent à jour leurs propres tournées de collecte, pour leur besoins d'exploitation et en fonction des évolutions de terrain.\r\n\r\nLa première version de ce jeu de données date de septembre 2024.</gco:CharacterString>\r\n      </gmd:abstract>\r\n      <gmd:status>\r\n        <gmd:MD_ProgressCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#MD_ProgressCode" codeListValue="onGoing" />\r\n      </gmd:status>\r\n      <gmd:pointOfContact>\r\n        <gmd:CI_ResponsibleParty>\r\n          <gmd:individualName>\r\n            <gco:CharacterString>MEL - Métropole Européenne de Lille</gco:CharacterString>\r\n          </gmd:individualName>\r\n          <gmd:organisationName>\r\n            <gco:CharacterString>Métropole Européenne de Lille</gco:CharacterString>\r\n          </gmd:organisationName>\r\n          <gmd:contactInfo>\r\n            <gmd:CI_Contact>\r\n              <gmd:address>\r\n                <gmd:CI_Address>\r\n                  <gmd:electronicMailAddress>\r\n                    <gco:CharacterString>opendata@lillemetropole.fr</gco:CharacterString>\r\n                  </gmd:electronicMailAddress>\r\n                </gmd:CI_Address>\r\n              </gmd:address>\r\n            </gmd:CI_Contact>\r\n          </gmd:contactInfo>\r\n          <gmd:role>\r\n            <gmd:CI_RoleCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_RoleCode" codeListValue="originator" />\r\n          </gmd:role>\r\n        </gmd:CI_ResponsibleParty>\r\n      </gmd:pointOfContact>\r\n      <gmd:pointOfContact>