751	<gmd:MD_Metadata xmlns:gmd="http://www.isotc211.org/2005/gmd" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns:gco="http://www.isotc211.org/2005/gco" xmlns:srv="http://www.isotc211.org/2005/srv" xmlns:gmx="http://www.isotc211.org/2005/gmx" xmlns:gts="http://www.isotc211.org/2005/gts" xmlns:gsr="http://www.isotc211.org/2005/gsr" xmlns:gmi="http://www.isotc211.org/2005/gmi" xmlns:gml="http://www.opengis.net/gml/3.2" xmlns:xlink="http://www.w3.org/1999/xlink" xsi:schemaLocation="http://www.isotc211.org/2005/gmd http://schemas.opengis.net/csw/2.0.2/profiles/apiso/1.0.0/apiso.xsd">\r\n  <gmd:fileIdentifier>\r\n    <gco:CharacterString>7eb795c2-d612-4b5e-b15e-d985b0f4e697</gco:CharacterString>\r\n  </gmd:fileIdentifier>\r\n  <gmd:language>\r\n    <gmd:LanguageCode codeList="http://www.loc.gov/standards/iso639-2/" codeListValue="fre" />\r\n  </gmd:language>\r\n  <gmd:hierarchyLevel>\r\n    <gmd:MD_ScopeCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#MD_ScopeCode" codeListValue="interactiveMap" />\r\n  </gmd:hierarchyLevel>\r\n  <gmd:contact>\r\n    <gmd:CI_ResponsibleParty>\r\n      <gmd:organisationName>\r\n        <gco:CharacterString>Office français de la biodiversité</gco:CharacterString>\r\n      </gmd:organisationName>\r\n      <gmd:contactInfo>\r\n        <gmd:CI_Contact>\r\n          <gmd:phone>\r\n            <gmd:CI_Telephone />\r\n          </gmd:phone>\r\n          <gmd:address>\r\n            <gmd:CI_Address>\r\n              <gmd:electronicMailAddress>\r\n                <gco:CharacterString>cartotheque@ofb.gouv.fr</gco:CharacterString>\r\n              </gmd:electronicMailAddress>\r\n            </gmd:CI_Address>\r\n          </gmd:address>\r\n        </gmd:CI_Contact>\r\n      </gmd:contactInfo>\r\n      <gmd:role>\r\n        <gmd:CI_RoleCode codeListValue="pointOfContact" codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_RoleCode" />\r\n      </gmd:role>\r\n    </gmd:CI_ResponsibleParty>\r\n  </gmd:contact>\r\n  <gmd:dateStamp>\r\n    <gco:DateTime>2019-05-22T07:11:47.802Z</gco:DateTime>\r\n  </gmd:dateStamp>\r\n  <gmd:identificationInfo>\r\n    <gmd:MD_DataIdentification>\r\n      <gmd:citation>\r\n        <gmd:CI_Citation>\r\n          <gmd:title>\r\n            <gco:CharacterString>Carte dynamique sur la répartition des ongulés sauvages en France</gco:CharacterString>\r\n          </gmd:title>\r\n          <gmd:date>\r\n            <gmd:CI_Date>\r\n              <gmd:date>\r\n                <gco:Date>2024-05-27</gco:Date>\r\n              </gmd:date>\r\n              <gmd:dateType>\r\n                <gmd:CI_DateTypeCode codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_DateTypeCode" codeListValue="creation" />\r\n              </gmd:dateType>\r\n            </gmd:CI_Date>\r\n          </gmd:date>\r\n          <gmd:presentationForm>\r\n            <gmd:CI_PresentationFormCode codeListValue="mapDigital" codeList="http://standards.iso.org/iso/19139/resources/gmxCodelists.xml#CI_PresentationFormCode" />\r\n          </gmd:presentationForm>\r\n        </gmd:CI_Citation>\r\n      </gmd:citation>\r\n      <gmd:abstract>\r\n        <gco:CharacterString>----------------------------\r\nContexte &amp; objectifs\r\n----------------------------\r\n\r\nDans le cadre de ses missions, l’OFB (anciennement l’ONC puis l’ONCFS) réalise le suivi des populations de grands ongulés sauvages en France métropolitaine. \r\nPour réaliser cette tâche complexe un réseau de correspondants départementaux, l’actuel réseau « Ongulés sauvages OFB-FNC-FDC » a été créée en 1985, et fonctionne grâce à la collaboration entre l’OFB et les fédérations nationale (FNC) et départementales des chasseurs (FDC). \r\n\r\nLes données ont été compilées à partir des données fournies par les Interlocuteurs techniques des FDC du Réseau Ongulés sauvages OFB-FNC-FDC pour toutes les espèces d'ongulés sauvages présentes en France métropolitaine.\r\n\r\n----------------------------\r\nLes espèces concernées\r\n----------------------------\r\n\r\nLes espèces concernées sont les suivantes : \r\nBouquetin des Alpes (Capra ibex)\r\nBouquetin ibérique (Capra pyrenaica)\r\nCerf élaphe (Cervus elaphus)\r\nCerf sika (Cervus nippon)\r\nChamois (Rupicapra rupicapra)\r\nDaim (Dama dama)\r\nIsard (Rupicapra pyrenaica)\r\nMouflon de Corse (Ovis gmelinii musimon)\r\nMouflon méditerranéen (Ovis gmelini musimon x Ovis sp.)\r\nMuntjac de Chine (Muntiacus reevesi)\r\net le Mouflon à manchettes (Ammotragus lervia).\r\n\r\n----------------------------\r\nProtocole et limites d'utilisations \r\n----------------------------\r\nLa méthode se basant sur des connaissances locales de la présence de populations établies par des professionnels connaissant bien leur territoire, la notion d’échantillonnage qualifiée d’"exhaustif" est crédible.\r\nLe travail est réalisé par unité de population, c’est-à-dire par secteur occupé par au minimum un groupe d’individus adultes susceptibles de se rencontrer et d’établir entre eux des rapports sociaux et génétiques (reproduction). Il peut donc exister des individus isolés présents en dehors des zones délimitées par ce programme.\r\nPour des raisons administratives l’inventaire est fait par département. Ainsi pour une population à cheval sur plusieurs départements chaque portion départementale constitue une zone. Un département peut abriter plusieurs zones. \r\nLes données sont vérifiées, harmonisées et validées par l’administrateur(rice) national(e) du réseau tous les 5 ans (avec un rythme différents selon les espèces).\r\n\r\n----------------------------\r\nFréquence de mise à jour\r\n----------------------------\r\n\r\npériodique \r\n\r\n----------------------------\r\nOutils\r\n----------------------------\r\n\r\nLes données de chacune de ces espèces sont consultables sur la carte interactive de l'espèce. créées à partir de l'outil Lizmap.</gco:CharacterString>\r\n      </gmd:abstract>\r\n      <gmd:pointOfContact>\r\n     